import React from 'react'

import { TableRow, TableCell } from '@mui/material';

const StaffTableColNames = () => {
  const tableCellSX = {
    color: 'white',
    fontSize: 'medium',
    all
  }
  return (
    <TableRow sx={{
      bgcolor: '#03074f',
      border: '2px'
    }}>
      <TableCell sx={tableCellSX}>S/R</TableCell>
      <TableCell sx={tableCellSX}>ΟΝΟΜΑ</TableCell>
      <TableCell sx={tableCellSX}>ΕΠΩΝΥΜΟ</TableCell>
      <TableCell sx={tableCellSX}>ΑΣΜΑ</TableCell>
      <TableCell sx={tableCellSX}>ΣΩΜΑ</TableCell>
      <TableCell sx={tableCellSX}>ΒΑΘΜΟΣ</TableCell>
      <TableCell sx={tableCellSX}>ΕΙΔΙΚΟΤΗΤΑ</TableCell>
      <TableCell sx={tableCellSX}>ΠΑΡΟΥΣΙΑΣΤΙΚΟ</TableCell>
      <TableCell sx={tableCellSX}>ΚΙΝΗΤΟ ΤΗΛΕΦΩΝΟ</TableCell>
      <TableCell sx={tableCellSX}>ΥΠΗΡΕΣΙΑΚΟ ΤΗΛΕΦΩΝΟ</TableCell>
      <TableCell sx={tableCellSX}>ΘΕΣΗ ΕΥΘΥΝΗΣ</TableCell>
      <TableCell sx={tableCellSX}>ΕΙΔΙΚΗ ΚΑΤΗΓΟΡΙΑ</TableCell>
      <TableCell sx={tableCellSX}>ΑΟΡΙΣΤΟΥ</TableCell>
      <TableCell sx={tableCellSX}>ΠΛΗΡΩΜΗ ΜΤΑ</TableCell>
    </TableRow>
  )
}

export default StaffTableColNames;
